import axios from "axios";

const api = axios.create({
  baseURL: "http://localhost:3333",
});

export const novosUsuariosApi = api.create({
  baseURL: "/novosusuarios",
});

export const usuariosApi = api.create({
  baseURL: "/usuarios",
});
